function go(t){$.get("../xml/movielist.csv",(function(r){for(var e=$.csv.toArrays(r),s='<a href="',n="</a>",d="",i=1;i<e.length;i++){var h=e[i][0];if(84!=t||t!=h.substring(0,1).charCodeAt()||"The"!=h.substring(0,3)||h.substring(0,5)=="The "+String.fromCharCode(t)){if(t==h.substring(0,1).charCodeAt()||h.substring(0,3)=="A "+String.fromCharCode(t)||h.substring(0,5)=="The "+String.fromCharCode(t)){var a=e[i][2],o=e[i][1],c=e[i][3];e[i][4];d=d+"<tr>"+((a="<td>"+a+"</td>")+(h="<td>"+s+o+'">'+h+n+"</td>")+(c="<td>"+c+"</td>"))+"</tr>"}if(35==t&&h.substring(0,1).charCodeAt()>=48&&h.substring(0,1).charCodeAt()<=57){a=e[i][2],o=e[i][1],c=e[i][3],e[i][4];d=d+"<tr>"+((a="<td>"+a+"</td>")+(h="<td>"+s+o+'">'+h+n+"</td>")+(c="<td>"+c+"</td>"))+"</tr>"}}}document.getElementById("results").innerHTML='<tr><th class="center" width="15%">Drunk Scale</th><th class="center" width="55%">Title</th><th class="center" width="30%">Run Time</th></tr>'+d}))}